Teens Like It Big - Ally Kay - Throbbing the Cradle

May 31, 2011

When Ally's dad invites one of his old college buddies to spend the weekend at their place, she isn't too excited. When her dad gives his buddy her room, however, she's downright pissed. She's pissed until she meets him that is. Ally is going to find a way to make the most out of the situation.
